export const COLUMNS = [
  {
    Header: "Common Name",
    accessor: "comName",
    Cell: (props) => {
      console.log(props.com);
      return <td com={props.com}>com</td>;
    },
  },
  {
    Header: "Scientific Name",
    accessor: "sciName",
    Cell: (props)=>{
      console.log(props.sci)
      return <td sci={props.sci}>sci</td>
    }
  },
  {
    Header: "Location",
    accessor: "locName",
  },
  {
    Header: "Date",
    accessor: "obsDt",
  },
];
